private void parseEndTag() {
tq.consume("</");
String tagName = tq.consumeTagName();
tq.chompTo(">");
if (tagName.length() != 0) {
Tag tag = Tag.valueOf(tagName);
if (!last().tag().isIgnorableEndTag(tag)) // skips </tr> if in <table>
popStackToClose(tag);
}

private Element last() {
return stack.getLast();
}

public boolean matches(String seq) {
int count = seq.length();
if (count > remainingLength())
return false;
while (--count >= 0) {
if (Character.toLowerCase(seq.charAt(count)) != Character.toLowerCase(queue.charAt(pos+count)))
return false;
return true;
}

public TextNode(String text, String baseUri) {
this.baseUri = baseUri;
this.text = text;
}

public Character consume() {
Character c = queue.charAt(pos);
pos++;
return c;
}

private void parseTextNode() {
if (tq.peek().equals('<')) {
String text = tq.consumeTo("<");
textNode = TextNode.createFromEncoded(text, baseUri);
last().appendChild(textNode);
}

public Character peek() {
return isEmpty() ? null : queue.charAt(pos);
}

public String consumeTo(String seq) {
int offset = queue.indexOf(seq, pos);
if (offset != -1) {
String consumed = queue.substring(pos, offset);
pos += consumed.length();
return consumed;
return remainder();
}

public Document normalise() {
Element htmlEl = findFirstElementByTagName("html", this);
if (htmlEl == null)
if (head() == null)
if (body() == null)
normaliseTextNodes(head());
normaliseTextNodes(htmlEl);
normaliseTextNodes(this);
normaliseStructure("head", htmlEl);
normaliseStructure("body", htmlEl);
return this;
}

